import React from "react";
import { Container } from "react-bootstrap";
import NavPanel from "./NavPanel";
import CategoriesDropdown from "./CategoriesDropdown";
import ProductCards from "./ProductCards";

function MainPage() {
    return (
        <div>
            <NavPanel />
            <Container>
                <CategoriesDropdown />
                <ProductCards />
            </Container>
        </div>
    );
}

export default MainPage;
